import React, { useState, useEffect } from 'react';
import { Link, useNavigate, Routes, Route } from 'react-router-dom';
import { FiBarChart, FiMenu, FiLogOut } from 'react-icons/fi';
import DashboardHome from '../components/DashboardHome';

const PharmacienDashboard = () => {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(true);
  const [user, setUser] = useState({});
  const [stats, setStats] = useState({});

  useEffect(() => {
    setTimeout(() => {
      setUser({ nom: '[NOM]' });
      setStats({ total: 42 });
      setLoading(false);
    }, 1000);
  }, []);

  if (loading) return <div className="min-h-screen flex items-center justify-center">Chargement...</div>;

  return (
    <div className="min-h-screen bg-gray-100">
      <div className="lg:ml-64">
        <header className="bg-white shadow-sm border-b p-4">
          <button className="p-2 rounded-lg hover:bg-gray-100"><FiMenu className="h-6 w-6" /></button>
        </header>
        <main style={{ padding: '20px' }}>
          <Routes>
            <Route path="/" element={<DashboardHome user={user} stats={stats} />} />
            <Route path="*" element={<div>Page non trouv√©e</div>} />
          </Routes>
        </main>
      </div>
    </div>
  );
};

export default PharmacienDashboard;
